column2:
Looking to see if anyone thinks this would be useful. Right now the only way to get code quality data is with sonar. I've investigated and it seems that Jenkins has endpoints that can be hit to obtain junit, jacoco, findbugs, pmd, and checkstyle data with plugins. This would be used to populate a bunch of the code quality data. There is nothing for security analysis, technical debt, or "functional tests".

This would allow users to use the codequality widget without relying on sonar. It would be a Jenkins specific implementation.

@amitmawkin @tabladrum @satishc1

For example, gerrit collector in hygieia server get the last commit info from gerrit server, and now gerrit server is 2:00, hygieia server is 3:00.  Then gerrit server has a new commit at 2:10, collector will get commit info from 3:00, it can't get the commit info commited at 2:10, and will never get any new commit info.
So I suggest we can use the time in commit info as the last updated time, I have made a simple change in the collect method of the class GerritCollectorTask in my local code:

    @Override
    public void collect(Collector collector) {

        logBanner("Starting...");
        long start = System.currentTimeMillis();
        int repoCount = 0;
        int commitCount = 0;

        clean(collector);
        for (GerritRepo repo : enabledRepos(collector)) {
     	
            LOG.debug(repo.getOptions().toString() + "::" + repo.getBranch());
            long lastCommitUpdateTime = 0L;

            for (Commit commit : getCommits(repo)) {
                LOG.debug(commit.getTimestamp() + ":::" + commit.getScmCommitLog());
                               
                if (isNewCommit(repo, commit)) {
        	
                    commit.setCollectorItemId(repo.getId());
                    commitRepository.save(commit);
                    commitCount++;       
                    //why when commitCount==1, because we arrange commit info in reverse chronological order according to the time.
                    if (commitCount == 1) {                  
                        lastCommitUpdateTime = commit.getScmCommitTimestamp();					
		        }
                }
            }
            
            //why do this setting, in order to ignore different time.
            //If can't get any commit info, don't change lastUpdatedTime.
            if (lastCommitUpdateTime != 0L) {
		 repo.setLastUpdated(lastCommitUpdateTime);
	    }          
            repo.removeLastUpdateDate();  //moved last update date to collector item. This is to clean old data.
            gerritRepoRepository.save(repo);
            
            repoCount++;
        }
        log("Repo Count", start, repoCount);
        log("New Commits", start, commitCount);
        log("Finished", start);
    }

Hope it's useful.

